import './style.css';
import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './header.jsx';
import Main from './main.jsx';
import Footer from './footer.jsx';
import ErrorBoundary from './ErrorBoundary.js'; // Импортируем ErrorBoundary

import TwelveNotesAlbom from './twelve_notes_albom.jsx';
import TheseTwoWindows from './these_two_windows_albom.jsx';

import TwNotesSong from './tw_notes_song.jsx';
import WaysToGoSong from './ways_to_go_song.jsx';
import InALittleSong from './in_a_little_song.jsx';
import DifferentKindOfBeautifulSong from './different_kind_of_beautiful_song.jsx';
import PickMeSong from './pick_me_song.jsx';
import SacrificeTomorrowSong from './sacrifice_tomorrow_song.jsx';
import ISentMyTherapistToTherapySong from './i_sent_my_therapist_to_therapy_song.jsx';
import TheArsonistSong from './the_arsonist_song.jsx';
import LeadMeToWaterSong from './lead_me_to_water_song.jsx';
import ByNowSong from './by_now_song.jsx';
import KingSizeBedSong from './king_size_bed_song.jsx';
import LoveTheOnesWhoLeaveSong from './love_the_ones_who_leave_song.jsx';

import MindIsAPrisonSong from './mind_is_a_prison_song.jsx';
import DemonsSong from './demons_song.jsx';
import OhMyGodSong from './oh_my_god_song.jsx';
import TheBookOfYouAndISong from './the_book_of_you_&_i_song.jsx';
import MatchInTheRainSong from './match_in_the_rain_song.jsx';
import JesusInLaSong from './jesus_in_la_song.jsx';
import IAmNotACynicSong from './i’m_not_a_cynic_song.jsx';
import AlamoSong from './alamo_song.jsx';
import MustHaveBeenTheWindSong from './must_have_been_the_wind_song.jsx';
import JustLikeYouSong from './just_like_you_song.jsx';

function App() {
  return (
    <>
      <BrowserRouter>
        <Header />

        {/* Оборачиваем весь контент в ErrorBoundary */}
        <ErrorBoundary>
          <Routes>
            <Route path="/" element={<Main />} />
            <Route path="/twelve_notes_albom/song/:id" element={<TwelveNotesAlbom />} />
            <Route path="/these_two_windows_albom/song/:id" element={<TheseTwoWindows />} />
            <Route path="/tw_notes_song" element={<TwNotesSong />} />
            <Route path="/ways_to_go_song" element={<WaysToGoSong />} />
            <Route path="/in_a_little_song" element={<InALittleSong />} />
            <Route path="/different_kind_of_beautiful_song" element={<DifferentKindOfBeautifulSong />} />
            <Route path="/pick_me_song" element={<PickMeSong />} />
            <Route path="/sacrifice_tomorrow_song" element={<SacrificeTomorrowSong />} />
            <Route path="/i_sent_my_therapist_to_therapy_song" element={<ISentMyTherapistToTherapySong />} />
            <Route path="/the_arsonist_song" element={<TheArsonistSong />} />
            <Route path="/lead_me_to_water_song" element={<LeadMeToWaterSong />} />
            <Route path="/by_now_song" element={<ByNowSong />} />
            <Route path="/king_size_bed_song" element={<KingSizeBedSong />} />
            <Route path="/love_the_ones_who_leave_song" element={<LoveTheOnesWhoLeaveSong />} />
            <Route path="/mind_is_a_prison_song" element={<MindIsAPrisonSong />} />
            <Route path="/demons_song" element={<DemonsSong />} />
            <Route path="/oh_my_god_song" element={<OhMyGodSong />} />
            <Route path="/the_book_of_you_&_i_song" element={<TheBookOfYouAndISong />} />
            <Route path="/match_in_the_rain_song" element={<MatchInTheRainSong />} />
            <Route path="/jesus_in_la_song" element={<JesusInLaSong />} />
            <Route path="/i’m_not_a_cynic_song" element={<IAmNotACynicSong />} />
            <Route path="/alamo_song" element={<AlamoSong />} />
            <Route path="/must_have_been_the_wind_song" element={<MustHaveBeenTheWindSong />} />
            <Route path="/just_like_you_song" element={<JustLikeYouSong />} />
          </Routes>
        </ErrorBoundary>

        <Footer />
      </BrowserRouter>
    </>
  );
}

export default App;
